import React from "react";

function Form(){
    return (
        <div className="Form">
            <form >
                <h1>Form</h1>
                <label >Country</label>
                <select>
                    <option value="India">India</option>
                    <option value="America">America</option>
                    <option value="Rush">Rush</option>
                    <option value="England">England</option>
                </select>
            </form>
        </div>
    )
}
export default Form;
